syntax = "proto3";
package proto;
import "google/protobuf/any.proto";
option go_package = ".;proto";

message Input {
    map<string, string> data = 1;
    google.protobuf.Any any = 2;
}

message OutPut {
    google.protobuf.Any any = 1;
    int32 rt = 2;
    int64 startTime = 3;
    map<string, string> data = 4;
}

service Plugin {
    rpc Run(Input) returns (OutPut);
}
